import { Component } from 'react';
import data from './../data.json';
import { Table } from 'react-bootstrap'

class UserList extends Component {

    constructor(props) {
        super(props)
        this.state = {
            newData: []
        }
    }


    addData() {
        var arr = [];
        for (var i in Object.keys(data.users)) {
            for (var j in Object.values(data.users)) {
            }
            var key = Object.keys(data.users)[i]
            var values = Object.values(data.users)[j]
            arr.push({
                key: key,
                value: values
            })
        }
        this.setState({ newData: arr })
    }
    componentDidMount() {

    }
    render() {
        return (
            <div>
                <div>
                    <h1>Data fetched from Firebase Real Time Database</h1>
                </div>
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>User ID</th>
                            <th>Name</th>
                            <th>Account</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>1</td>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                        </tr>
                        <tr>
                            <td>2</td>
                            <td>Jacob</td>
                            <td>Thornton</td>
                            <td>@fat</td>
                        </tr>
                        <tr>
                            <td>3</td>
                            <td colSpan="2">Larry the Bird</td>
                            <td>@twitter</td>
                        </tr>
                    </tbody>
                </Table>
            </div>
        )
    }
}
export default UserList
